import Vue from 'vue';
import Vuex from 'vuex';

Vue.use(Vuex);

export default new Vuex.Store({
  state: {
    count: 0
  },
  getters:{
    myCount(state){
      return `hi ~ ${state.count}`
    }
  },
  mutations: {
    increment (state) {
      state.count ++
    },
    decrement(state){
      state.count --
    }
  },
  actions: {
    myIncrease(context){
      context.commit('increment')
    },
    myDecrement(context){
      context.commit('decrement')
    },
  },
});
